import React from "react";
import {
    Container,
    Navbar,
    NavbarBrand,
    NavbarNav,
    NavbarToggler,
    Collapse,
    NavItem,
    NavLink,
    Fa
} from "mdbreact";
import { BrowserRouter as Router } from "react-router-dom";

class FixedNavbarExample extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            collapse: false
        };
        this.onClick = this.onClick.bind(this);
    }

    onClick() {
        this.setState({
            collapse: !this.state.collapse
        });
    }

    render() {
        const bgPink = { backgroundColor: "#ec407a" };
        const container = { height: 1300 };
        return (
            <div>
                <Router>
                    <Navbar
                        style={bgPink}
                        dark
                        expand="md"
                        scrolling
                        fixed="top"
                    >
                        <NavbarBrand href="/">
                            <strong>Navbar</strong>
                        </NavbarBrand>
                        <NavbarToggler onClick={this.onClick} />
                        <Collapse isOpen={this.state.collapse} navbar>
                            <NavbarNav left>
                                <NavItem active>
                                    <NavLink to="#">Home</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink to="#">Features</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink to="#">Pricing</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink to="#">Options</NavLink>
                                </NavItem>
                            </NavbarNav>
                            <NavbarNav right>
                                <NavItem>
                                    <NavLink to="#">
                                        <Fa icon="facebook" />
                                    </NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink to="#">
                                        <Fa icon="twitter" />
                                    </NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink to="#">
                                        <Fa icon="instagram" />
                                    </NavLink>
                                </NavItem>
                            </NavbarNav>
                        </Collapse>
                    </Navbar>
                </Router>
            </div>
        );
    }
}

export default FixedNavbarExample;
